import React from 'react';
import {Link}  from 'react-router-dom';


const Home = function ({meters, setData}) {

  var getData = function ( event, id) {
    console.log('test1')
    axios.get(`/meters/METER_ID/?id=${id}`)
    .then ( (response)=> {
      setData(response.data);
      console.log(response.data);
    })
    .catch( (err) => {
      alert(err);
    })
  }

  return (
 <div>
   <h1>Meters Name</h1>
  {meters.length > 0 ? meters.map((meter, index)=>( <Link to='/infor' id={index} onClick={(event)=>{getData(event, meter.id)}}>meter name: {meter.label}</Link>)):null}
  </div>
  )
}

export default Home;
